import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import {Link} from "react-router-dom";
import Particles from 'react-particles-js';
import './index.css'

export default class Homepage extends Component {
  render() {
  return (
      <div className="Homepage">
        <div class="wrap">
          <nav class="navbar">
            <div class="icon">
              <i class="fa fa-user"/>
            </div>
            <div class="icon">
              <i class="fa fa-bookmark"></i>
              <p>Portfolio</p>
            </div>
          </nav>
        </div>
        <Particles style={{position: "fixed", width: "100%", zIndex:"0", left:0}} params={{particles: {number: {value: 50}}}}/>
          <h1><strong>Hi, my name is Phoenix!</strong></h1>
            <div className="bird-wrapper">
              <img class="bird-img" src={require('./Gang.svg')}/>
            </div>
          <h2><strong>Rising Developer!</strong></h2>
      </div>
    );
  }
}
